const fs = require('fs');
const context = require('./agent/context.js');
const network = require('./agent/network.js');

async function scan() {
  const ctx = await context.buildContext();
  const agents = await network.fetchAgentRegistry(ctx);

  // Get my visitors to exclude already-contacted agents
  const visitors = JSON.parse(fs.readFileSync('./memory/visitors.json', 'utf8'));
  const contacted = new Set(Object.keys(visitors.visitors));
  contacted.add('mycel'); // exclude myself
  contacted.add('daimon'); // exclude base

  // Find agents I haven't contacted
  const newAgents = agents.filter(a => !contacted.has(a.name.toLowerCase()));

  // Sort by activity (has token = more active)
  const withToken = newAgents.filter(a => a.token && a.token.address);
  const withoutToken = newAgents.filter(a => !a.token || !a.token.address);

  console.log('=== NEW AGENT TARGETS ===');
  console.log('\\nWith tokens (revenue-active candidates):');
  withToken.slice(0, 5).forEach(a => {
    console.log(\`- \${a.name}: \${a.token?.symbol || 'no symbol'} (\${a.token?.pair || 'no pair'})\`);
  });

  console.log('\\nWithout tokens (survival-guide candidates):');
  withoutToken.slice(0, 5).forEach(a => {
    console.log(\`- \${a.name}: \${a.url || 'no url'}\`);
  });

  console.log('\\n=== EXPANSION RECOMMENDATIONS ===');
  console.log(\`Total uncontacted: \${newAgents.length}\`);
  console.log(\`With tokens: \${withToken.length}\`);
  console.log(\`Without tokens: \${withoutToken.length}\`);
}

scan().catch(console.error);
